        _symbol = symbol_;
        _maxSupply = maxSupply_;
        _currentIndex = _startTokenId(); 
        _salt = salt_;   
        _DCFperBlock = 2e18;   
        _startBlockNumber = block.number;    
    }

  

    function BlockScore(address user)public view returns(uint256){
        uint256 difference = block.number.sub(_BlockScore[user][1]);
        uint256 Product = balanceOf(user).mul(difference);
        uint256 accumulation = _BlockScore[user][2].add(Product);
        return accumulation;
    }

    function updateBlockScore(address user)private{
        uint256 accumulation = BlockScore(user);       
        _BlockScore[user][2]= accumulation;       
        _BlockScore[user][1] = block.number; 
    }



